import React from 'react';

const Navbar = () => {
    return (
        <div>
           <ul>
                <li><a href="default.asp">Home</a></li>
                <li><a href="news.asp">Posts</a></li>
                <li><a href="contact.asp">Contact</a></li>
                <li><a href="about.asp">About</a></li>
            </ul>
        </div>
    )
}

export default Navbar;
